WHERE {
    ?protein a up:Protein ;
            up:reviewed true ;
            up:annotation ?annotation .

    ?annotation up:catalyticActivity ?activity .

    # Get the evidence attribution
    ?statement rdf:object ?annotation ;
              up:attribution/up:evidence ?evidence .

    # Filter for experimental evidence codes
    VALUES ?evidence { 
        obo:ECO_0000269  # Experimental evidence used in manual assertion
        obo:ECO_0007744  # Experimental evidence
    }
}

